import React from "react";
import AppNav from "./Nav";

function ContactUs () {
    return (
        <div>
            <AppNav/>

            <h1>Contact Us</h1>
            <h4>Group Members</h4>
            <h6>Mohammad Abusalah</h6>
            <p>Email: mohammad.abusalah@mavs.uta.edu</p>
            <h6>Richard Tran</h6>
            <p>Email: richard.tran3@mavs.uta.edu</p>
            <h6>Tim Tran</h6>
            <p>Email: tim.tran@mavs.uta.edu</p>
        </div>

    );
}

export default ContactUs;
